#function to calculate freq of each dinucleotide at each bp
AA_AT_TA_TT_freq () { awk -v V1=$(cat $OUTPUT/$DINUC_TSV | awk -v column=$1 '$column == "AA"' | wc -l) -v V2=$(cat $OUTPUT/$DINUC_TSV | awk -v column=$1 '$column == "AT"' | wc -l) -v V3=$(cat $OUTPUT/$DINUC_TSV | awk -v column=$1 '$column == "TA"' | wc -l) -v V4=$(cat $OUTPUT/$DINUC_TSV | awk -v column=$1 '$column == "TT"' | wc -l) -v V5=$(cat $OUTPUT/$RANDOM_DINUC_TSV | awk -v column=$1 '$column == "AA"' | wc -l) -v V6=$(cat $OUTPUT/$RANDOM_DINUC_TSV | awk -v column=$1 '$column == "AT"' | wc -l) -v V7=$(cat $OUTPUT/$RANDOM_DINUC_TSV | awk -v column=$1 '$column == "TA"' | wc -l) -v V8=$(cat $OUTPUT/$RANDOM_DINUC_TSV | awk -v column=$1 '$column == "TT"' | wc -l) 'BEGIN {x1 = V1; x2 = V2; x3 = V3; x4 = V4; y1 = V5; y2 = V6; y3 = V7; y4 = V8; u = x1+x2+x3+x4; w = log((x1+x2+x3+x4+1)/(y1+y2+y3+y4+1))log(2); z = log((x1+x2+x3+x4)/(y1+y2+y3+y4))log(2); {if (u==0) {printf "%.3f\n", w} else {printf "%.3f\n", z}}}'; }

